script: |
  super -f tsv -I q5535.sql | sort > q5535.out

vector: true

inputs:
  - name: q5535.sql
    data: |
      SELECT DISTINCT ( - cor0.col2 + + cor0.col0 ) / - 34 AS col0 FROM tab0 AS cor0 GROUP BY cor0.col2, cor0.col0;
  - name: tab0

outputs:
  - name: q5535.out
    data: |
      -1
      0
      1
